import { Link } from "react-router-dom";

const About = () => {
  return (
    <div className="about">
      <h4>Version 1.0.0</h4>
      <p>
        <em>My Contact </em>
        <br></br>helps you to store your contacts in one place.
      </p>
      <Link to="/">Go Back</Link>
    </div>
  );
};

export default About;
